import React from 'react';

import UsersList from '../components/UsersList';

const Users = () => {
    const USERS = [
        {
            id: 'u1',
            name: 'Aman Soni', 
            image: 'https://traveltriangle.com/blog/cottages-in-ooty-for-couples/', 
            places: 3
        }
    ];


    return < UsersList items={USERS} />;
};

export default Users;
